import { library } from '@fortawesome/fontawesome-svg-core';
import {
    faChevronLeft,
    faChevronDown,
    faChevronUp,
    faUserCircle,
    faCog,
    faSignOutAlt,
    faFolder,
    faFolderOpen,
} from '@fortawesome/free-solid-svg-icons';

library.add(faChevronLeft, faChevronDown, faChevronUp, faUserCircle, faCog, faSignOutAlt, faFolder, faFolderOpen);
